import React, { useState, useEffect } from 'react';
import './App.css';
import MaterialTable from 'material-table'


function table1() {

  const [data, setData] = useState([])
  const columns = [
    { title: "ID", field: "id" },
    { title: "description", field: "description" },

  ]
  useEffect(() => {
    fetch("http://localhost:3333/layer1")
      .then(resp => resp.json())
      .then(resp => {
        setData(resp)
      })
  }, [])

  return (
    <div >

      <MaterialTable
        title="Employee Data"
        data={data}
        columns={columns}
      />
    </div>
  );
}

export default table1;
